BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "ยี่ห้อ" (
	"รหัสยี่ห้อสินค้า"	varchar(4) NOT NULL UNIQUE,
	"ชื่อยี่ห้อสินค้า"	nvarchar(25) NOT NULL UNIQUE,
	PRIMARY KEY("รหัสยี่ห้อสินค้า")
);
CREATE TABLE IF NOT EXISTS "ประเภทสินค้า" (
	"รหัสประเภทสินค้า"	varchar(4) NOT NULL UNIQUE,
	"ชื่อประเภทสินค้า"	nvarchar(25) NOT NULL UNIQUE,
	PRIMARY KEY("รหัสประเภทสินค้า")
);
CREATE TABLE IF NOT EXISTS "พนักงาน" (
	"รหัสพนักงาน"	varchar(4) NOT NULL UNIQUE,
	"ชื่อจริง"	nvarchar(25),
	"นามสกุล"	nvarchar(25),
	"เบอร์โทรศัพท์"	varchar(10),
	"username"	nvarchar(25),
	"password"	nvarchar(25),
	PRIMARY KEY("รหัสพนักงาน")
);
CREATE TABLE IF NOT EXISTS "ลูกค้า" (
	"รหัสลูกค้า"	varchar(6) NOT NULL UNIQUE,
	"ชื่อจริง"	nvarchar(25),
	"นามสกุล"	nvarchar(25),
	"username"	nvarchar(25),
	"password"	nvarchar(25),
	"อีเมล"	nvarchar(50),
	"เบอร์โทรศัพท์"	varchar(10),
	"ที่อยู่"	nvarchar(100),
	PRIMARY KEY("รหัสลูกค้า")
);
CREATE TABLE IF NOT EXISTS "สินค้า" (
	"รหัสสินค้า"	varchar(6) NOT NULL UNIQUE,
	"ชื่อสินค้า"	varchar(50),
	"รูปสินค้า"	BLOB,
	"สินค้าคงเหลือ"	INTEGER,
	"รายละเอียดสินค้า"	TEXT,
	"ราคาต่อหน่วย"	REAL NOT NULL,
	"รหัสยี่ห้อสินค้า"	varchar(4),
	"รหัสประเภทสินค้า"	varchar(4),
	FOREIGN KEY("รหัสประเภทสินค้า") REFERENCES "ประเภทสินค้า"("รหัสประเภทสินค้า"),
	FOREIGN KEY("รหัสยี่ห้อสินค้า") REFERENCES "ยี่ห้อ"("รหัสยี่ห้อสินค้า"),
	PRIMARY KEY("รหัสสินค้า")
);
CREATE TABLE IF NOT EXISTS "รายละเอียดการขาย" (
	"รหัสรายละเอียดการขาย"	varchar(6) NOT NULL UNIQUE,
	"ราคาต่อหน่วย"	REAL,
	"จำนวน"	INTEGER,
	"รหัสการขาย"	nvarchar(50),
	"รหัสสินค้า"	varchar(6),
	FOREIGN KEY("รหัสการขาย") REFERENCES "การขาย"("รหัสการขาย"),
	FOREIGN KEY("รหัสสินค้า") REFERENCES "สินค้า"("รหัสสินค้า"),
	PRIMARY KEY("รหัสรายละเอียดการขาย")
);
CREATE TABLE IF NOT EXISTS "การชำระ" (
	"รหัสการชำระ"	varchar(6) NOT NULL UNIQUE,
	"รหัสการขาย"	varchar(6),
	"ยอดชำระ"	REAL,
	"ชื่อธนาคาร"	nvarchar(25),
	"วันเวลาที่ชำระ"	DATETIME,
	"username"	nvarchar(25),
	"หลักฐานการชำระ"	BLOB,
	FOREIGN KEY("รหัสการขาย") REFERENCES "การขาย"("รหัสการขาย"),
	PRIMARY KEY("รหัสการชำระ")
);
CREATE TABLE IF NOT EXISTS "การขาย" (
	"รหัสการขาย"	varchar(6) NOT NULL UNIQUE,
	"รหัสพนักงาน"	varchar(4),
	"รหัสลูกค้า"	varchar(6),
	"วันเวลาที่สั่ง"	DATETIME,
	"สถานะการขาย"	vaechar(50),
	FOREIGN KEY("รหัสพนักงาน") REFERENCES "พนักงาน"("รหัสพนักงาน"),
	FOREIGN KEY("รหัสลูกค้า") REFERENCES "ลูกค้า"("รหัสลูกค้า"),
	PRIMARY KEY("รหัสการขาย")
);
