INSERT INTO "สินค้า" VALUES ('P00001','ADIDAS City Canvas',X'',1000,'กำหนดโชคชะตาของตัวเองไปกับ รองเท้าลำลองผู้ชาย ADIDAS City Canvas ที่โดดเด่นด้วยผืนผ้าใบเปล่าที่รอให้คุณมาแต่งแต้มสไตล์ที่เป็นตัวเอง ปล่อยความเป็นอิสระของคุณ พาไปในทิศทางที่คุณต้องการ และยังมาพร้อมซิกเนเจอร์การเย็บตะเข็บแบบซิกแซกบนแถบ 3-Stripes และลิ้นรองเท้า',800.0,'B004','T004');
INSERT INTO "สินค้า" VALUES ('P00002','ADIDAS Grand Court Cloudfoam Lifestyle Court Comfort Superstar',X'',999,'ดีไซเนอร์ของอาดิดาสไม่เคยที่จะหยุดพัฒนาสนีกเกอร์สุดคลาสสิก รองเท้าลำลองผู้ชาย ADIDAS Grand Court Cloudfoam Lifestyle Court Comfort Superstar นำไอคอนจากวันวานอย่างรองเท้า Grand Court มาสู่ยุคปัจจุบัน อัปเปอร์หนังเทียมสัมผัสนุ่มซับด้านในเพื่อความสบาย พื้นชั้นกลาง Cloudfoam มาพร้อมความเบาและช่วยลดแรงกระแทกที่เหมาะสำหรับสวมใส่ตลอดวัน',1500.0,'B003','T004');
INSERT INTO "สินค้า" VALUES ('P00003','NIKE Victori One Next Nature',X'',998,'รองเท้าแตะผู้ชาย NIKE Victori One Next Nature คือรองเท้าที่ขาดไม่ได้ในวันแดดจ้า ทั้งบนชายหาดและบนอัฒจันทร์ น้ำหนักเบา และสวมใส่ง่าย มาพร้อมโฟมนุ่มตอบสนองได้ดี',650.0,'B002','T001');
INSERT INTO "สินค้า" VALUES ('P00004','ADIDAS Adilette Aqua',X'',999,'รองเท้าแตะแบบสวม ดีไซน์คลาสสิคเป็นรุ่นดังของ ADIDAS ที่คุณไม่ควรพลาด มี cloudfoam ที่พื้นรองเท้าชั้นกลาง ให้คุณใส่สบายตลอดวัน',480.0,'B003','T001');
INSERT INTO "สินค้า" VALUES ('P00005','FILA Elite Court V2 ',X'',999,'คงความสบาย แต่ยังสามารถบ่งบอกความเป็นแฟชั่นในตัวคุณด้วยรองเท้าลำลองผู้ใหญ่ FILA Elite Court V2 ผลิตจากวัสดุที่มีคุณภาพ มาพร้อมแบบผูกเชือกที่ช่วยให้คุณปรับความพอดีได้ตามต้องการ และออกแบบมาให้ความรู้สึกถึงความสะอาดตาและเรียบง่าย ช่วยให้คุณจับคู่กับเสื้อผ้าได้ทุกแบบ',1640.0,'B001','T004');
INSERT INTO "สินค้า" VALUES ('P00006','FILA Blast',X'',999,'รองเท้าวิ่งผู้ชาย FILA Blast ดีไซน์ข้อต่ำ แบบผูกเชือก สามารถปรับกระชับได้ มาพร้อมอัปเปอร์ตัดเย็บจากผ้าตาข่าย เนื้อสัมผัสนุ่ม น้ำหนักเบาและระบายอากาศได้ดี บุรอบข้อเท้าและลิ้นรองเท้าช่วยเพิ่มความนุ่มสบายและการซัพพอร์ต พื้นรองเท้าด้านนอกแต่งแพทเทิร์นช่วยยึดเกาะพื้นผิวได้อย่างทนทาน ในขณะที่พื้นรองเท้าด้านในและชั้นกลางช่วยดูดซับแรงกระแทกและซัพพอร์ตเท้าอย่างยืดหยุ่น พร้อมมอบความนุ่มเบาสบายสูงสุดในทุกๆสเต็ปตลอดการวิ่ง',1250.0,'B001','T002');
INSERT INTO "สินค้า" VALUES ('P00007','ASICS Novablast 4 TR',X'',999,'รองเท้าวิ่งผู้ชาย ASICS Novablast 4 TR โดดเด่นด้วยพื้นรองเท้าชั้นกลางและพื้นรองเท้าชั้นนอกแบบใหม่ที่ช่วยสร้างพลังในการขับเคลื่อน ออกแบบมาให้มีพื้นรองเท้าชั้นนอกแบบเทรลโดยเฉพาะซึ่งใช้งานได้สำหรับการวิ่งบนพื้นผิวออฟโรด โครงสร้างปีกลิ้นรองเท้าที่ส่วนบนช่วยปรับปรุงความพอดีพร้อมทั้งลดการเคลื่อนไหวของลิ้น ส่วนประกอบนี้เสริมความแข็งแรงด้วยการออกแบบส้นเท้าที่รองรับเพื่อช่วยควบคุมเท้าและควบคุมวงจรการเดินของคุณได้ดีขึ้น​ ระบบกันกระแทก FF BLAST™ PLUS ECO ผลิตจากวัสดุชีวภาพรีไซเคิล 20% วัสดุนี้ช่วยสร้างการลงสู่พื้นที่นุ่มนวลขึ้นและการออกตัวที่มีพลังมากขึ้นในระหว่างการฝึกซ้อม',5200.0,'B004','T002');
INSERT INTO "สินค้า" VALUES ('P00008','ASICS Metaspeed Sky',X'',998,'รองเท้าวิ่งผู้ใหญ่ ASICS Metaspeed Sky+ ออกแบบมาเพื่อนักวิ่งแบบสไตรด์ที่ต้องการออกวิ่งได้อย่างรวดเร็วและเข้าเส้นชัยได้เร็วยิ่งกว่า จะสามารถก้าวได้ไกลมากขึ้นโดยรักษาพลังงานในแต่ละก้าวไว้ได้ และยังมาพร้อมโฟมพื้นรองเท้าชั้นกลางที่มีพลังและแผ่นคาร์บอนที่ช่วยส่งแรงทำให้สามารถเก็บแรงได้มากขึ้น ในขณะที่ยังคงจังหวะของตนไว้จนถึงตอนท้ายของการแข่งขันได้',850.0,'B004','T002');
INSERT INTO "สินค้า" VALUES ('P00009','VICTOR Storm',X'',998,'อัปเปอร์ตัดเย็บจากหนัง PU และผ้าตาข่าย 2 ชั้น น้ำหนักเบาและมีความทนทานสูงดีไซน์ข้อต่ำ แบบผูกเชือก สามารถปรับกระชับได้พื้นรองเท้าชั้นกลางทำจาก Resilient EVA ผสานเทคโนโลยี ENERGYMAX ช่วยดูดซับแรงกระแทก และมอบการตอบสนองขณะเปลี่ยนทิศทางได้ดี รวมทั้งซัพพอร์ตอย่างนุ่มยืดหยุ่นและเบาสบายเท้าพื้นรองเท้าด้านนอกทำจากยาง แต่งแพทเทิร์นกันลื่น ช่วยยึดเกาะพื้นผิวสนามได้ดี',2784.0,'B005','T003');
INSERT INTO "สินค้า" VALUES ('P00010','VICTOR P9200HA',X'',999,'อัปเปอร์ตัดเย็บจากหนัง PU, TPU และผ้าตาข่าย น้ำหนักเบาและมีความทนทานสูงสไตล์ข้อต่ำ แบบผูกเชือก สามารถปรับกระชับได้บุรอบข้อเท้าและลิ้นรองเท้า ช่วยเพิ่มความนุ่มสบายมีรูระบายอากาศที่อัปเปอร์และด้านข้างพื้นรองเท้าด้านนอกทำจากยาง VSR แต่งแพทเทิร์นกันลื่น ช่วยยึดเกาะพื้นผิวสนามได้ดีพื้นรองเท้าชั้นกลางทำจากโฟม EVA ผสานเทคโนโลยี ENERGYMAX3.0 ช่วยดูดซับแรงกระแทก และมอบการตอบสนองขณะเปลี่ยนทิศทางได้ดี รวมทั้งซัพพอร์ตอย่างนุ่มยืดหยุ่นและเบาสบายเท้า',4384.0,'B005','T003');
